var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'AG1組員名單', 'text': '40723104\xa0 \xa0 https://s40723104.github.io/cd2020/content/index.html 40723107 \xa0 \xa0 https://s40723107.github.io/cd2020/content/index.html 40723114 \xa0 (group leader)\xa0\xa0 https://s40723114.github.io/cd2020/content/index.html 40723115 \xa0 \xa0 https://s40723115.github.io/cd2020/content/index.html 40723118 \xa0\xa0 https://s40723118.github.io/cd2020/content/index.html 40723122\xa0 \xa0 https://s40723122.github.io/cd2020/content/index.html 40723123\xa0\xa0 https://s40723123.github.io/cd2020/content/index.html 40723140\xa0\xa0 https://s40723140.github.io/cd2020/content/index.html 40723149 \xa0\xa0 https://s40723149.github.io/cd2020/content/index.html 40723151\xa0 \xa0 https://s40723151.github.io/cd2020/content/index.html 40723153 \xa0 \xa0 https://s40723153.github.io/cd2020 40723154 \xa0\xa0 https://s40723154.github.io/cd2020/content/index.html 40723155 \xa0\xa0 https://s40723155.github.io/cd2020/content/index.html', 'tags': '', 'url': 'AG1組員名單.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': '課程內容', 'text': '', 'tags': '', 'url': '課程內容.html'}, {'title': 'week1', 'text': '建立個人倉儲cd2020及進行網站編譯 \n 建立個人倉儲以及完成CMSIMDE網站 \n 個人倉儲: \n \n CMSIMDE 網站架設: \n \n \n', 'tags': '', 'url': 'week1.html'}, {'title': 'week2', 'text': 'Fork分組倉儲並更新python3.8.2 \n Fork分組倉儲: \n \n \n 更新python到python3.8.2 \n 1.進入\xa0 https://www.python.org/downloads/release/python-382/ \n 2.滑至最底，找到 Windows x86-64 executable installer 並下載。 \n 3.下載完成後開啟 \n 4.不要勾選pip選項，接著按下next \n \n 5.選擇路徑將python安裝至可攜式系統中的Y槽下 \n 6.接著開啟start_mdecourse.bat批次檔 \n 7.將安裝的版本資料夾取名為py382 \n \n 8.將 start_mdecourse.bat批次檔中的py373改為安裝python 3.8.2版本的資料夾 \n \n 8.執行stop.bat批次檔後重新啟動start_mdecourse(為了讓檔案重新讀取) \n 9.輸入get-pip.py，開始安裝pip工具 \n \n 10.安裝cmsimde所需模組 \n 輸入pip install flask bs4 lxml pelican markdowm flask_cors \n \n 完成後確認版本是否成功更新即完成更新python3.8.2 \n \n', 'tags': '', 'url': 'week2.html'}, {'title': 'week6', 'text': '課程內容: \n 安裝OBSPortable.exe與yotube做配合,往後拍影片,頭像左下角需要有自己的影像 \n 安裝並開啟pyslvs.exe,設定四連趕模擬,觀察連趕運動方向 \n \n', 'tags': '', 'url': 'week6.html'}, {'title': 'week8', 'text': '\n', 'tags': '', 'url': 'week8.html'}, {'title': 'Assignment', 'text': '', 'tags': '', 'url': 'Assignment.html'}, {'title': 'Assignment1', 'text': 'Random grouping 亂數分組 \n 亂數分組程式 \n \n 以下為測試出來的分組名單 \n \n 影片: \n \n', 'tags': '', 'url': 'Assignment1.html'}, {'title': 'Webots tutorial', 'text': '', 'tags': '', 'url': 'Webots tutorial.html'}, {'title': 'Webots入門', 'text': '', 'tags': '', 'url': 'Webots入門.html'}, {'title': 'The Scene Tree(場景樹)', 'text': '如上一節所述，要訪問“場景樹窗口”，可以 Scene Tree 在 Tools 菜單中選擇，也可以按 Show Scene Tree 主工具欄中的按鈕。場景樹包含描述模擬世界（包括機器人和環境）及其圖形表示的信息。Webots的場景樹的結構類似於VRML97文件。它由節點列表組成，每個節點包含字段。字段可以包含值（文本字符串，數字值）或其他節點。 \n 本節描述了“場景樹”的用戶界面，並概述了VRML97節點和Webots節點。 \n \n 場景樹窗口 \n \n 場景樹具有上下文菜單，該上下文菜單包含許多有用的操作，具體取決於選擇，包括但不限於：剪切，複製和粘貼操作，將字段重置為其默認值，將 視點 移至對象，設置 視點 跟隨對象，或打開文檔查看器以查看所選節點的文檔。 \n 此外，如果當前選擇是 Robot 節點（或後代，或 PROTO 基於 Robot的 實例 ），則可以在文本編輯器中打開相應的機器人窗口或打開機器人的控制器。 \n 現場編輯 \n 可以雙擊擴展節點。 選擇字段後，可以在“場景樹”的底部編輯其值。 雙擊或按 Enter 字段上 的 鍵將選擇字段編輯器面板的第一個可編輯項目。 可以通過在字段編輯器面板中的所有項目之間切換來將鍵盤焦點返回到“場景樹”。 對於文本字段，通過按鍵應用更改 Enter 。 這對於數字字段是相同的，但是向上和向下箭頭鍵也可以用於向上和向下調整值，並立即應用更改。 對於復選框，使用 Space 欄 更改值 。 應用的更改將立即反映在3D窗口中。 字段編輯器部分提供以下按鈕： \n \n Webots節點編輯器 \n \n \n \n 顯示調整大小手柄 ：顯示用於調整大小和縮放3D窗口中選定節點的手柄。 僅對“幾何”節點和“ \xa0 變換” 節點 派生的節點顯示此選項 。 對於過程性PROTO節點，僅當在模板語句中未使用調整大小或縮放所涉及的字段時才可用。 \n \n \n', 'tags': '', 'url': 'The Scene Tree(場景樹).html'}, {'title': 'Preferences(首選項)', 'text': '可以通過對話框修改Webots首選項，該對話框可以從 Webots / Preferences Mac上的菜單項打開，也可以從 Tools / Preferences 其他操作系統上的菜單項打開。 \n 該對話框分為多個選項卡。 以下每個小節對應於這些選項卡之一。 \n 指數 \n \n 一般 \n OpenGL \n 網絡 \n \n 一般 \n 在 常規 選項卡包含有關應用程序的各種喜好。 \n \n 在 語言 選項允許您選擇Webots用戶界面（需要重新啟動）的語言。 \n 在 啟動模式 ，您可以選擇模擬的狀態時Webots開始（暫停，實時，運行速度快;看到 Simulation 菜單）。 \n 所述 編輯器的字體 定義中Webots文本編輯器，並在控制台將要使用的字體。 建議選擇固定寬度的字體，以更好地顯示源代碼。 此首選項的默認值在Windows上為“ Consolas，10”，在Mac上為“ Courier，14”，在Linux上為“ Monospace”。 \n 該 線程數 確定有多少線程可以通過Webots最大創建。 推薦值與計算機處理器的邏輯核心數匹配。 在某些特定情況下（例如，當另一個進程強烈需要其他內核時）降低此值可能很有趣。 目前，該值僅影響物理引擎速度和控制器編譯速度。 請注意，這是允許的最大線程數，但是實際使用的線程數是 WorldInfo 節點 的 optimalThreadCount 字段中 定義的數量 。 \n 的 Python的命令 的Python命令由Webots開始一個Python控制器時調用定義。 默認值為 python 。 假定它 python 已安裝並且可以從命令行使用，那麼 它應該可以在大多數係統上工作 。 在某些系統上， python3.7 例如，如果要使用此特定版本的Python啟動控制器， 將其設置為有用 。 請記住，此值可能會被 runtime.ini Python控制器文件 的內容所覆蓋，該 文件可能會重新定義啟動該控制器的特定Python命令。 \n 該 額外項目的路徑 定義了類似的用戶文件夾的路徑 WEBOTS_HOME/projects 文件夾。 該用戶文件夾應包含可在當前項目中使用的項目資源（例如PROTO節點，控制器，紋理等）。 它可能包含多個子文件夾，每個子文件夾都與一個子項目相關聯（應該遵守 一個項目 的 標准文件層次結構 ）。 該文件夾還可以包含一個 default 項目，可用於定義通用控制器，紋理，聲音等。 \n “ \xa0 警告：僅針對場景樹編輯 顯示警告”複選框可防止Webot在通過更改視點，拖動，旋轉，施加力或通過修改當前世界退出，重新加載或加載新世界時顯示任何警告對話框窗口。施加到物體上的扭矩，或通過控制器修改世界。 但是，如果從場景樹修改了世界，它將仍然顯示警告。 \n 該 遙測：發送技術資料Webots developpers 複選框允許Webots，以便發送匿名的技術數據Webots developpers以幫助改進軟件。 此處 提供了所有已發送數據的完整說明 。 \n 該 更新策略：檢查Webots更新在啟動時 複選框允許Webots以檢查是否有新版本可供下載在每次啟動。 如果可用，對話框窗口將通知您。 \n \n OpenGL \n 在 OpenGL 選項卡包含有關設置的3D渲染能力的偏好。 這些設置的默認參數可能會因係統的硬件和OpenGL功能而從一台計算機到另一台計算機。 \n \n \n “ \xa0 環境光遮擋” 選項使您可以啟用 GTAO ，這是3D視圖上屏幕空間環境光遮擋的一種現代形式。 此選項可在場景中實現更高水平的真實感，但性能成本卻不可忽略。 為了減輕這種情況，默認情況下將其設置為“中等”質量。 超高品質可提供最佳結果，但性能最高。 \n \n \n Texture Quality （ 紋理質量） 選項使您可以降低場景中所有紋理的分辨率，以節省GPU內存。 如果設置為 high 最大可用分辨率（即原始分辨率），將使用。 如果設置為 medium ，則將大於或等於1024的圖像分辨率除以2（分別考慮寬度和高度）。 如果設置為 low ，則將大於或等於512的圖像分辨率除以4。 \n \n \n “ \xa0 禁用陰影” 選項使您可以完全禁用3D視圖和“ \xa0 相機” 渲染中 的陰影 ，無論 Light.castShadows 字段 的值 如何 。 \n \n \n 在全球範圍內，可以通過禁用此功能來提高性能，但另一方面，渲染更難於理解且不夠美觀。 \n \n 在 禁用抗鋸齒 選項，可以禁止在3D視圖和抗鋸齒 相機 渲染。 Webots使用的抗鋸齒算法是 SMAA 1x 。 我們觀察到一些舊的圖形硬件不支持有關抗鋸齒的OpenGL功能。 在這種情況下，最好禁用抗鋸齒功能。 否則，禁用抗鋸齒功能可能會導致性能略有提高，但會降低圖形保真度。 \n \n 網絡 \n 該 網絡 標籤，您可以手動配置HTTP代理，該代理Webots將利用在互聯網上訪問其許可證服務器。 \n \n \n 該 代理服務器類型 複選框允許您啟用或禁用襪子v5代理協議。 \n \n \n 該 代理主機 字段，您可以設置代理服務器的主機名。 \n \n \n 在 代理端口 字段允許您設置代理服務器使用的端口。 \n \n \n 該 代理的用戶名 字段是可選的。 它允許您指定發送到代理服務器的用戶名。 \n \n \n 該 代理密碼 字段是可選的，以及，並允許您指定發送到代理服務器的用戶密碼。 \n \n \n 更改代理配置後，建議重新啟動Webot，以確保正確考慮了更改。 如果清除“ \xa0 代理主機名” 字段，Webots將在下次啟動時嘗試檢索默認的系統代理。 \n', 'tags': '', 'url': 'Preferences(首選項).html'}, {'title': '直播會議討論', 'text': '', 'tags': '', 'url': '直播會議討論.html'}, {'title': 'w2', 'text': '1.分配小組工作內容 \n 2.問題討論 \n \n', 'tags': '', 'url': 'w2.html'}, {'title': 'w3', 'text': '會議內容: \n 講解python亂數分組程式,以及跟各個細分組長說明接下來必須同時對小組網站進行協同,小組長必須以pull request的方式將改版網站給組長,組長在選擇merge,解決可能合併會產生的問題 \n \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w5', 'text': '會議內容: \n 了解webots totural , 並翻譯 \n 註冊onshape \n onshape \n 下載webots \n \n', 'tags': '', 'url': 'w5.html'}, {'title': 'w6', 'text': '開會內容 \n 1.webots tutorial分配到的趕快完成 2.每個人都須安裝OBS,之後拍影片右下角要有自己的頭像 3.請大家這段時間自行學習Coppeliasim,之後要用這套軟體模擬 4.請安裝pyslvs,並且學習這套軟體,之後要在四輪車上加上提球機構 ,需要彼此討論機構設計,去進行模擬 5.TOP0及TOP1的文章,記得有時間可以去看一下 6.Handout meet線上上課說明 \n \n', 'tags': '', 'url': 'w6.html'}, {'title': 'w7', 'text': '說明線上課程如何實施 \n \n', 'tags': '', 'url': 'w7.html'}, {'title': 'w8', 'text': '', 'tags': '', 'url': 'w8.html'}]};